import React, { useState } from 'react';

function ProjectManager({ user, onEnterDashboard }) {
  const [projectName, setProjectName] = useState('');
  const [projectDescription, setProjectDescription] = useState('');
  const [newProjectId, setNewProjectId] = useState('');
  const [existingProjectId, setExistingProjectId] = useState('');

  const handleCreateProject = (e) => {
    e.preventDefault();
    console.log('Creating project:', {
      user,
      projectName,
      projectDescription,
      newProjectId,
    });
    onEnterDashboard(newProjectId);
  };

  const handleAccessProject = (e) => {
    e.preventDefault();
    console.log('Accessing project:', {
      user,
      existingProjectId,
    });
    onEnterDashboard(existingProjectId);
  };

  return (
    <div className="card">
      <h2>Welcome, {user}!</h2>

      <form onSubmit={handleCreateProject}>
        <h3>Create New Project</h3>
        <input
          type="text"
          placeholder="Project Name"
          value={projectName}
          onChange={(e) => setProjectName(e.target.value)}
          required
        />
        <input
          type="text"
          placeholder="Project Description"
          value={projectDescription}
          onChange={(e) => setProjectDescription(e.target.value)}
          required
        />
        <input
          type="text"
          placeholder="Project ID"
          value={newProjectId}
          onChange={(e) => setNewProjectId(e.target.value)}
          required
        />
        <button type="submit">Create Project</button>
      </form>

      <hr style={{ margin: '20px 0' }} />

      <form onSubmit={handleAccessProject}>
        <h3>Use Existing Project</h3>
        <input
          type="text"
          placeholder="Project ID"
          value={existingProjectId}
          onChange={(e) => setExistingProjectId(e.target.value)}
          required
        />
        <button type="submit">Access Project</button>
      </form>
    </div>
  );
}

export default ProjectManager;
